import ExpenseItem from "./Components/ExpenseItem";

function App() {
  const expences = [
    { title: "Car Insurance", date: new Date(2021, 11, 15), price: 294.67 },
    { title: "Bike Insurance", date: new Date(2021, 5, 4), price: 46 },
    { title: "Belenciaga", date: new Date(2021, 3, 14), price: 67 },
    { title: "Karl Lagerfield", date: new Date(2021, 11, 3), price: 89 },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>
      <ExpenseItem
        title={expences[0].title}
        date={expences[0].date}
        price={expences[0].price}
      />
      <ExpenseItem
        title={expences[1].title}
        date={expences[1].date}
        price={expences[1].price}
      />
      <ExpenseItem
        title={expences[2].title}
        date={expences[2].date}
        price={expences[2].price}
      />
      <ExpenseItem
        title={expences[3].title}
        date={expences[3].date}
        price={expences[3].price}
      />
    </div>
  );
}

export default App;
